MAIN                PROC FAR      
                    MOV AH,0
                    MOV AL,13H
                    INT 10H
                    ASSUME DS:DATA6
                    MOV AX , DATA6
                    MOV DS , AX
                    MOV SI, OFFSET BACKGROUND
                    DRAW_OBJECT 200,320,0,0

                    ASSUME DS:DATA4
                    MOV AX , DATA4
                    MOV DS , AX
                    
                    CHECKMENUE:
                    MOV AH, 1
                    INT 16H
                    JNZ F1LABEL

                    F1LABEL:
                    ;{ TAKE THE USER INPUT FROM THE KEYBOARD BUFFER
                        MOV    AH, 0
                        INT    16H      
                        CALL   CLEARKEYBOARDBUFFER  
                    ;} 
                     CMP AH, 3BH 
                     JNE F2LABEL
                     CALL PLAYER1INFO
                     JMP START
                    
                    F2LABEL:
                     CMP AH, 3CH 
                     JNE CHECKMENUE
                     CALL PLAYER2INFO
                     JMP START

                    START:
                        ASSUME DS:DATA4
                        MOV AX , DATA4
                        MOV DS , AX
                      ;{ OPEN VEDIO MODE
                        MOV     AX, 4F02H
                        MOV     BX, 105H
                        INT     10H
                    ;}
                     ;{ CLEAR THE PAGE
                        MOV     AX, 0600H
                        MOV     BH, 0
                        MOV     CX, 0
                        MOV     DX, 184FH
                        INT     10H
                ;}
                ;{ CURSUR = (34H,1AH)
                    MOV     AH, 2
                    MOV     DX, 1075H
                    INT     10H
                ;}
                ;}
                    MOV AH,9
                    MOV BH,0
                    MOV CX,1
                    MOV AL,'R'
                    MOV BL,2FH
                    INT 10H


                ;{ CURSUR = (34H,1AH)
                    MOV     AH, 2
                    MOV     DX, 1076H
                    INT     10H
                ;}
                    MOV AH,9
                    MOV BH,0
                    MOV CX,1
                    MOV AL,'I'
                    MOV BL,2FH
                    INT 10H


                ;{ CURSUR = (34H,1AH)
                    MOV     AH, 2
                    MOV     DX, 1077H
                    INT     10H
                ;}
                    MOV AH,9
                    MOV BH,0
                    MOV CX,1
                    MOV AL,'G'
                    MOV BL,2FH
                    INT 10H


                ;{ CURSUR = (34H,1AH)
                    MOV     AH, 2
                    MOV     DX, 1078H
                    INT     10H
                ;}
                    MOV AH,9
                    MOV BH,0
                    MOV CX,1
                    MOV AL,'H'
                    MOV BL,2FH
                    INT 10H


                ;{ CURSUR = (34H,1AH)
                    MOV     AH, 2
                    MOV     DX, 1079H
                    MOV     CX, 5FH
                    INT     10H
                ;}
                    MOV AH,9
                    MOV BH,0
                    MOV CX,1
                    MOV AL,'T'
                    MOV BL,2FH
                    INT 10H
                ;}

                ;{ CURSUR = (34H,1AH)
                    MOV     AH, 2
                    MOV     DX, 1875H
                    INT     10H
                ;}
                ;}
                    MOV AH,9
                    MOV BH,0
                    MOV CX,1
                    MOV AL,'W'
                    MOV BL,4FH
                    INT 10H


                ;{ CURSUR = (34H,1AH)
                    MOV     AH, 2
                    MOV     DX, 1876H
                    INT     10H
                ;}
                    MOV AH,9
                    MOV BH,0
                    MOV CX,1
                    MOV AL,'R'
                    MOV BL,4FH
                    INT 10H


                ;{ CURSUR = (34H,1AH)
                    MOV     AH, 2
                    MOV     DX, 1877H
                    INT     10H
                ;}
                    MOV AH,9
                    MOV BH,0
                    MOV CX,1
                    MOV AL,'O'
                    MOV BL,4FH
                    INT 10H


                ;{ CURSUR = (34H,1AH)
                    MOV     AH, 2
                    MOV     DX, 1878H
                    INT     10H
                ;}
                    MOV AH,9
                    MOV BH,0
                    MOV CX,1
                    MOV AL,'N'
                    MOV BL,4FH
                    INT 10H


                ;{ CURSUR = (34H,1AH)
                    MOV     AH, 2
                    MOV     DX, 1879H
                    INT     10H
                ;}
                    MOV AH,9
                    MOV BH,0
                    MOV CX,1
                    MOV AL,'G'
                    MOV BL,4FH
                    INT 10H
                ;}
                    CALL DRAWCHIKENS
                    CALL DRAWPLAYER
                MAINLOOP:                          
              ;{ DELAY 0.125 SECOND  WHERE DELAY IN MELLISECOND IS CXDX  CX AND MSB AND DX AS LSB
                     MOV     CX, 00H
                     MOV     DX, 0C300H
                     MOV     AH, 86H
                     INT     15H
               ;}
               CALL UPDATEBULETANDCOLLSION
               CALL UPDATEPROBLEMANDMCQ

                ;{ CURSUR = (34H,1AH)
                    MOV     AH, 2
                    MOV     DX, 1277H
                    INT     10H
                ;}
               ;{
                    MOV AH,9
                    MOV BH,0
                    MOV CX,1
                    MOV DX,RIGHT
                    MOV AL,DL
                    ADD AL,30H
                    MOV BL,2FH
                    INT 10H
               ;}
               CMP RIGHT,6
               JNE MOVEC
               MOV WON,1
               JMP FINSHGAME

               
               MOVEC:
                ;{ CURSUR = (34H,1AH)
                    MOV     AH, 2
                    MOV     DX, 1A77H
                    INT     10H
                ;}
               CMP WRONG,6
               JNE MOVEW
               JMP FINSHGAME
               MOVEW:
               ;{
                    MOV AH,9
                    MOV BH,0
                    MOV CX,1
                    MOV DX,WRONG
                    MOV AL,DL
                    ADD AL,30H
                    MOV BL,4FH
                    INT 10H
               ;}
               MOV AH, 1
               INT 16H
               JZ MAINLOOP    
               ;{
                    CALL USERINPUT
                    JMP MAINLOOP
                ;}
                FINSHGAME:
    ;{ OPEN VEDIO MODE
        MOV     AX, 4F02H
        MOV     BX, 105H
        INT     10H
    ;}
    CMP WON,1
    JNE SKIP10
     YWN 40,40,150,220,01
    LOSS:
    MOV AH,4CH
    INT 21H
MAIN                ENDP  

