CLEARKEYBOARDBUFFER     PROC    NEAR
;{
    PUSH        AX
    PUSH        ES
    MOV     AX, 0000H
    MOV     ES, AX
    MOV     ES:[041AH], 041EH
    MOV     ES:[041CH], 041EH               ; CLEARS KEYBOARD BUFFER
    POP     ES
    POP     AX
    RETN
;}
CLEARKEYBOARDBUFFER     ENDP

