UPDATEPROBLEMANDMCQ              PROC   NEAR
;{
    CMP COLISION,1
    JNE NOPROBLEM
    CLEAR PROBLEMHEIGHT,PROBLEMWEDTH,PROBLEMSTARTPOSX,PROBLEMSTARTPOSY
    MOV DX,PROBLEMHEIGHT
    ADD DX,PROBLEMSTARTPOSY
    ADD PROBLEMSTARTPOSY,1
    CMP DX, 605
    JGE OUTOFBW
    CMP CLEARPROBLEM,1
    JE OUTOFBW
    CALL DRAWPROBLEMS
    JMP NOPROBLEM
    OUTOFBW:
    MOV INTEST,0
    MOV COLISION,0
    MOV CLEARPROBLEM,0
    NOPROBLEM:
    RETN
;}
UPDATEPROBLEMANDMCQ              ENDP

DRAWPROBLEMS            PROC    NEAR
;{
    CMP PROBLEMINTEST,0
    JNE B2
    CALL DRAWPROBLEM1
    JMP DONEP

    B2:
    CMP PROBLEMINTEST,1
    JNE B3
    CALL DRAWPROBLEM2
    JMP DONEP


    B3:
    CMP PROBLEMINTEST,2
    JNE B4
    CALL DRAWPROBLEM3
    JMP DONEP

    B4:
