UPDATEBULETANDCOLLSION              PROC   NEAR
;{
    CMP BULETEXIST,1
    JNE UPDATED
    CLEAR BULETHEIGHT,BULETWEDTH,BULETSTARTPOSX,BULETSTARTPOSY
    SUB BULETSTARTPOSY,2
    CMP BULETSTARTPOSY, 138
    JLE COLIDE
    CALL DRAWBULET
    JMP UPDATED
    COLIDE:
    CALL DRAWPROBLEM
    
    MOV BULETEXIST,0
    CMP CHOSSEDPLAYER, 1
    JNE BU2
    CALL PLAYER1INFO
    CALL SWEATERCOLISIONS
    CALL REDCOLISIONS
    CALL MILITARYCOLISIONS
    CALL MAGENTICCOLISIONS
    CALL PARTYCOLISIONS
    CALL BOSSCOLISIONS
    JMP UPDATED
    BU2:
    CALL PLAYER2INFO
    CALL SWEATERCOLISIONS
    CALL REDCOLISIONS
    CALL MILITARYCOLISIONS
    CALL MAGENTICCOLISIONS
    CALL PARTYCOLISIONS
    CALL BOSSCOLISIONS
    UPDATED:
    RETN
;}
UPDATEBULETANDCOLLSION              ENDP



