USERINPUT               PROC   NEAR
;{
    ;{
        MOV AH, 0
        INT 16H 
        CALL CLEARKEYBOARDBUFFER  
    ;}
    CMP AL,1BH
    JNE MOVELEFT
    ;{ OPEN VEDIO MODE
        MOV     AX, 4F02H
        MOV     BX, 105H
        INT     10H
    ;}
    MOV AH,4CH
    INT 21H
    MOVELEFT:
        CMP AH, 4BH 
        JNE MOVERIGHT
        CMP PLAYSTARTPOSX,10
        JLE SKIP1
        CLEAR PLAYERMHEIGHT,PLAYERMWEDTH,PLAYSTARTPOSX,PLAYSTARTPOSY
        SUB PLAYSTARTPOSX, 3
        SUB BULETSTARTPOSX, 3
        SUB BULET1STARTPOSX, 3
        SUB BULET2STARTPOSX, 3
        CALL DRAWPLAYER
        MOV PRESSED,1
    JMP EXIT
    
    SKIP1:
    JMP EXIT
    
    MOVERIGHT:
        CMP AH, 4DH 
        JNE FIRE
        CMP PLAYSTARTPOSX,744
        JGE EXIT
        CLEAR PLAYERMHEIGHT,PLAYERMWEDTH,PLAYSTARTPOSX,PLAYSTARTPOSY
        ADD PLAYSTARTPOSX, 3
        ADD BULETSTARTPOSX, 3
        ADD BULET2STARTPOSX, 3
        ADD BULET1STARTPOSX, 3
        CALL DRAWPLAYER
        MOV PRESSED,1
    FIRE:  
        CMP AL, 20H
        JNE EXIT
        CMP BULETEXIST, 0
        JNE EXIT
        CMP COLISION,0
        JNE EXIT
        MOV BULETEXIST, 1
        CALL DRAWBULET
        MOV PRESSED,1    
    EXIT:
        CMP PRESSED,1
        JNE TEEST
        MOV PRESSED,0
        RETN
        TEEST:
        CMP INTEST,1
        JE ONE
        RETN
        ONE:
        MOV DX,PROBLEMSOLUTION
        CMP AL, 31H
        JNE TWO
        CMP DX,1
        JNE NOANSWER
        INC RIGHT
        MOV CLEARPROBLEM,1
        JMP FINSHTEST


        TWO:
        CMP AL,32H
        JNE THREE
        CMP DX,2
        JNE NOANSWER
        INC RIGHT
        MOV CLEARPROBLEM,1
        JMP FINSHTEST

        THREE:
        CMP AL,33H
        JNE NOANSWER
        CMP DX,3
        JNE NOANSWER
        INC RIGHT
        MOV CLEARPROBLEM,1
        JMP FINSHTEST
        NOANSWER: 
        INC WRONG
        FINSHTEST:
RETN
;}
USERINPUT       ENDP


