DRAWCHIKENS           PROC  NEAR
;{
  RANDOMLOOP:  
  CMP CHIKENDRAWN,0
  JNE CON1
  RETN
  CON1:
  RANDOMIZE 0, 5, RANDOMIZEDCHIKEN, RANDSEED  
  CMP RANDOMIZEDCHIKEN,0
  JNE MAGENTICCHIKEN
  CMP BOSSMODELDRAWEN,1
  JNE MAGENTICCHIKEN
  CALL DRAWBOSSMODEL
  DEC BOSSMODELDRAWEN
  JMP RANDOMLOOP
  
  MAGENTICCHIKEN:
  CMP RANDOMIZEDCHIKEN,1
  JNE SWEATERCHIKEN
  CMP MAGNETICMODELDRAWEN,1
  JNE SWEATERCHIKEN
  CALL DRAWMAGNETICMODEL
  DEC MAGNETICMODELDRAWEN
  JMP RANDOMLOOP

  JMP CON0
  SKIP0:
  JMP RANDOMLOOP
  CON0:
  SWEATERCHIKEN:
  CMP RANDOMIZEDCHIKEN,2
  JNE REDCHIKEN
  CMP SWEATERMODELDRAWEN,1
  JNE REDCHIKEN
  CALL DRAWSWEATERMODEL
  DEC SWEATERMODELDRAWEN
  JMP SKIP0

  REDCHIKEN:
  CMP RANDOMIZEDCHIKEN,3
  JNE MILITARYCHIKEN
  CMP REDMODELDRAWEN,1
  JNE MILITARYCHIKEN
  CALL DRAWREDMODEL
  DEC REDMODELDRAWEN
  JMP SKIP0

  MILITARYCHIKEN:
  CMP RANDOMIZEDCHIKEN,4
  JNE PARTYCHIKEN
  CMP MILITARYMODELDRAWEN,1
  JNE PARTYCHIKEN
  CALL DRAWMILITARYMODEL
  DEC MILITARYMODELDRAWEN
  JMP SKIP0

  PARTYCHIKEN:
  CMP PARTYMODELDRAWEN,1
  JNE SKIP0
  CALL DRAWPARTYCHIKEN
  DEC PARTYMODELDRAWEN
  JMP SKIP0
;}
DRAWCHIKENS           ENDP  



DRAWPROBLEM           PROC  NEAR
;{  
  RANDOMPROBLEM:
  RANDOMIZE 0, 5, RANDOMIZEDPROBLEM, RANDSEED  
  CMP RANDOMIZEDPROBLEM,0
  JNE TAKEPROBLEM2
  CMP PROBLEM1TAKEN,1
  JNE TAKEPROBLEM2
  MOV INTEST,1
  DEC PROBLEM1TAKEN
  MOV PROBLEMINTEST,1
  JMP TAKED
  
  TAKEPROBLEM2:
  CMP RANDOMIZEDPROBLEM,1
  JNE TAKEPROBLEM3
  CMP PROBLEM2TAKEN,1
  JNE TAKEPROBLEM3
  MOV INTEST,1
  DEC PROBLEM2TAKEN
    MOV PROBLEMINTEST,2
  JMP TAKED
  
  SKIP2: JMP RANDOMPROBLEM
  
  TAKEPROBLEM3:
  CMP RANDOMIZEDPROBLEM,2
  JNE TAKEPROBLEM4
  CMP PROBLEM3TAKEN,1
  JNE TAKEPROBLEM4
  MOV INTEST,1
  DEC PROBLEM3TAKEN
    MOV PROBLEMINTEST,3
  JMP TAKED

  TAKEPROBLEM4:
  CMP RANDOMIZEDPROBLEM,3
  JNE TAKEPROBLEM5
  CMP PROBLEM4TAKEN,1
  JNE TAKEPROBLEM5
  MOV INTEST,1
  DEC PROBLEM4TAKEN
    MOV PROBLEMINTEST,4
  JMP TAKED

  TAKEPROBLEM5:
  CMP RANDOMIZEDPROBLEM,4
  JNE TAKEPROBLEM6
  CMP PROBLEM5TAKEN,1
  JNE TAKEPROBLEM6
  MOV INTEST,1
  DEC PROBLEM5TAKEN
    MOV PROBLEMINTEST,5
  JMP TAKED

  TAKEPROBLEM6:
  CMP PROBLEM6TAKEN,1
  JNE SKIP2
  MOV INTEST,1
  DEC PROBLEM6TAKEN
  MOV PROBLEMINTEST,6
  TAKED:
  RETN
;}
DRAWPROBLEM           ENDP  



